import connect from "./connect";
import onConnected from "./onConnected";

const registerUser = (onError, stompClient, setUserData, userData, privateChats, setPrivateChats, publicChats) => {   
  connect(() => onConnected(setUserData, stompClient, userData, privateChats, setPrivateChats, setPublicChats), onError, stompClient);
};

export default registerUser;
